import React from "react";

const Header = () => {
  return (
    <div className="row navbar_upper">
      <nav class="nav ">
        <a className="nav-item nav-link  " href="#">
          FACEBOOK
        </a>
        <a class="nav-item nav-link" href="#">
          INSTAGRAM
        </a>
        <a class="nav-item nav-link" href="#">
          TELEGRAM
        </a>
        <a class="nav-item nav-link " href="#">
          TWITTER
        </a>
        <a class="nav-item nav-link " href="#">
          GMAIL
        </a>
      </nav>
    </div>
  );
};

export default Header;
